import React, { Component } from 'react';
import './Contacts.css';
import {contactDetails} from './data';


export default class Contacts extends Component {
    render() {
        const contactLi =contactDetails.details.map(item=>{
            return <li className="contactUsLi"><div className="labelIcon" aria-label="Hover text">{item.icon}</div><div className="leftLabel">{item.label}</div><div className="labelInfo">{item.data}</div></li>
          })
        return (
            <div id="contactUsDiv">
                <h1>Contact Us</h1>
                <div className="contactUsCard">
                    <ul className="contactUsList">
                        {contactLi}
                    </ul>
                </div>
            </div>
        )
    }
}
